            }
        }
        .animation(.default, value: rotation)
        .onAppear {
            self.rotation = .pi
        }
    }
}

struct Triangle: Shape {
    var rotation: Double

    func path(in rect: CGRect) -> Path {
        let center = rect.midX
        let width = rect.width \/ 2

        let path = Path()
        path.move(to: CGPoint(x: center, y: rect.midY))
        path.addLine(to: CGPoint(x: center + width * cos(rotation), y: center + width * sin(rotation)))
        path.addLine(to: CGPoint(x: center - width * cos(rotation), y: center - width * sin(rotation)))
        path.closeSubpath()

        return path
    }
